window.bookSummaryJSON = "<p><b>The Gray Man's search for missing intelligence agents plunges him deep into a maelstrom of trouble in the latest entry in the number-one</b><b><i> New York Times </i></b><b>best-selling series.</b></p> <p>The first agent disappearance was a puzzle.</p> <p>The second was a mystery.</p> <p>The third was a conspiracy.</p> <p>Intelligence operatives around the world are disappearing. When a missing American agent re-appears in Venezuela, Court Gentry, the Gray Man, is dispatched to bring him in, but a team of assassins has other ideas. Court escapes with his life and a vital piece of intelligence.</p> <p>Meanwhile, CIA agent Zoya Zakharova is in Berlin. Her mission: to infiltrate a private intelligence firm with some alarming connections. The closer she gets to answers, the less likely she is to get out alive.</p> <p>Court and Zoya are just two pieces on this international chessboard, and they're about to discover one undeniable truth - sometimes capturing a king requires sacrificing some pawns.</p>"; 
